import React from 'react';
import { Route, Routes } from 'react-router-dom'
import { RoutePaths } from '../../routes/routePaths';

const HomePage = React.lazy(() => import('../HomePage/HomePage'));
const AllRecipesPage = React.lazy(() => import('../AllRecipesPage/AllRecipesPage'));
const FavouriteRecipesPage = React.lazy(() => import('../FavouriteRecipesPage/FavouriteRecipesPage'));
const ProfilePage = React.lazy(() => import('../ProfilePage/ProfilePage'));

function AppLayout() {
  return (
    <div className="AppLayout">
        <p>
            main page
        </p>
        <Routes>
            <Route path={RoutePaths.PROFILE}>
                <ProfilePage />
            </Route>
            <Route path={RoutePaths.FAVOURITE_RECIPES}>
                <FavouriteRecipesPage />
            </Route>
            <Route path={RoutePaths.ALL_RECIPES}>
                <AllRecipesPage />
            </Route>
            <Route path="/">
                <HomePage />
            </Route>
        </Routes>
    </div>
  );
}

export default AppLayout;
